import React from 'react';

const Sidebar = ({ notes }) => {
  return (
    <div>
      <ul>
        {notes &&
          notes.map((note) => {
            return (
              <li>
                <h1>{note.title}</h1>
                <p>{note.note}</p>
              </li>
            );
          })}
      </ul>
    </div>
  );
};

export default Sidebar;
